import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter section to be available
    await page.waitForSelector('.price-filter', { timeout: 5000 });

    // Locate and fill the minimum price input
    const minPriceInput = page.locator('#minPrice');
    await minPriceInput.fill('50');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_min_price_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_min_price_filled.png'));

    // Locate and fill the maximum price input
    const maxPriceInput = page.locator('#maxPrice');
    await maxPriceInput.fill('100');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_max_price_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_max_price_filled.png'));

    // Click the "Apply" button
    const applyButton = page.locator('button.apply-filter');
    await applyButton.click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_filter_applied.png'));

    // Extract the values to confirm the action
    const extractedMinPrice = await minPriceInput.inputValue();
    const extractedMaxPrice = await maxPriceInput.inputValue();

    return {
      success: true,
      action: "Applied price range filter from 50 to 100.",
      extractedData: {
        minPrice: extractedMinPrice,
        maxPrice: extractedMaxPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
